import React from 'react';
import FooterSection from '../FooterSection';

const Error = () => {
    return (
        <div>
        <section id="section1">
            <div>
                <p className="container">Oops! This page went missing</p>
            </div>
        </section>
        <FooterSection />
        </div>
    );
};

export default Error;
